import React from "react";
import ReactDOM from "react-dom";
import Sdata from "./Sdata";
import Card from "./Card";

ReactDOM.render(
    <>
    <h1> Top 5 Best Netflix Series in 2020</h1>  
    {Sdata.map((val,index) => {
        console.log(index);
            return (
                <Card
                    imgsrc = {val.imgsrc}
                    title = {val.title}
                    sname = {val.sname}
                    link = {val.link}
                />
            );
    })}  
    </>,
    document.getElementById("root")
);
